import React from 'react';

const Devices = () => {
    return (
        <div>
            <form action="">
                <div className="d-flex justiy-content-around">
                    <label htmlFor="modelOfDevice">Device Model</label>
                    <input type="text" id='modeOfDevice' placeholder='Meter_ABC'/>
                </div>
                <div className="d-flex justiy-content-around">
                    <label htmlFor="serialNumber">Serial Number</label>
                    <input type="text" id='serialNumber' placeholder='ABC012319'/>
                </div>
                <div className="d-flex justiy-content-around">
                    <label htmlFor="commissioningDate">Commissioning Date</label>
                    <input type="text" id='commissioningDate' placeholder='1699992929202'/>
                </div>
                <div className="d-flex justiy-content-around">
                    <label htmlFor="Var01">Level_Alarm_var01</label>
                    <input type="text" id='Var01' placeholder='30.5'/>
                </div>
            </form>
        </div>
    );
};

export default Devices;
